import React, { Component } from "react";
import axios from "axios";

class Home extends Component {
  state = {
    posts: [],
  };

  componendDidMount() {
    axios.get("https://jsonplaceholder.typicode.com/posts").then((res) => {
      console.log(res);
      this.setState({
        posts: res.data.slice(0, 10),
      });
    });
  }
  render() {
    const { posts } = this.state;
    const postList = posts.length ? (
      posts.map((post) => {
        return (
          <div className="post card" key={post.id}>
            <div className="card-content">
              <span className="card-title">{post.title}</span>
              <p>{post.body}</p>
            </div>
          </div>
        );
      })
    ) : (
      <div className="center">No posts yet</div>
    );
    return (
      <div className="container">
        <h4 className="center">Home</h4>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed felis
          justo, aliquam at sapien ac, efficitur vehicula diam. Cras porttitor a
          massa ac suscipit. Nam turpis ex, lacinia vel lobortis sed, tincidunt
          vitae enim. Suspendisse tincidunt erat ut urna tincidunt viverra.
          Morbi eget risus consequat, luctus libero at, tincidunt tellus. Mauris
          ac arcu arcu. Nam semper sit amet felis id vestibulum. Curabitur quam
          turpis, elementum tempor sodales non, volutpat sed purus. Mauris at
          ligula a sem dapibus porta nec at dolor. Fusce fermentum vel mi non
          luctus. Mauris et turpis diam. Integer risus nunc, sagittis ut
          scelerisque ac, luctus in velit.
        </p>
      </div>
    );
  }
}

export default Home;
